    render() {
        return (
            <div>
                <h1>{this.props.title}</h1>
                <p onCopy={this.noCopy}> lorem ipsum, dolor sit amet consecteteur.</p>
                <Car color="Yellow"> Ford </Car>
                <Car color="Black"> Mercedes </Car>
                <Car></Car>
            </div>
        )
    }
}

